import React from 'react';
import Card from './components/Card'
import cards from './cards.json'
import './App.css';

class App extends Component {
    state = {
      cards
    }  
    render() {
      return (
      <>
        <h1 className="title">Friends List</h1>
        {this.state.cards.map(card => (
          <Card
            key={card.id}
            name={card.name}
            image={card.image}
            id={card.id}
          />
        ))}
      </>
      )}

  }

export default App;
